// And groups predicates with the AND operator between them.
func And(predicates ...predicate.CampaignTarget) predicate.CampaignTarget {
	return predicate.CampaignTarget(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.CampaignTarget) predicate.CampaignTarget {
	return predicate.CampaignTarget(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.CampaignTarget) predicate.CampaignTarget {
	return predicate.CampaignTarget(sql.NotPredicates(p))
}
